import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { fetchQuestion, updateScore } from "../services/apiService"; // ✅ Using API service
import "../styles/Game.css";
import { Home as HomeIcon } from "lucide-react"; // ✅ Corrected import for Home icon

const Game = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const level = location.state?.level || "Easy";

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login"); // Redirect if not logged in
    }
  }, [navigate]);

  const getInitialTime = (level) => {
    switch (level) {
      case "Easy":
        return 30;
      case "Medium":
        return 20;
      case "Hard":
        return 10;
      default:
        return 20;
    }
  };

  const [question, setQuestion] = useState("");
  const [answer, setAnswer] = useState("");
  const [userInput, setUserInput] = useState("");
  const [feedback, setFeedback] = useState("");
  const [score, setScore] = useState(0);
  const [timeLeft, setTimeLeft] = useState(getInitialTime(level));

  useEffect(() => {
    fetchNewQuestion();

    const timer = setInterval(() => {
      setTimeLeft((prevTime) => {
        if (prevTime <= 1) {
          clearInterval(timer);
          alert("Time's up! ⏰");
          return 0;
        }
        return prevTime - 1;
      });
    }, 1000);

    return () => clearInterval(timer); // Cleanup interval
  }, []);

  const fetchNewQuestion = async () => {
    try {
      const data = await fetchQuestion();
      setQuestion(data.question);
      setAnswer(data.solution);
    } catch (err) {
      console.error("Error fetching question", err);
    }
  };

  const handleSubmit = async () => {
    if (parseFloat(userInput) === parseFloat(answer)) {
      setScore((prevScore) => prevScore + 10);
      setFeedback("Correct! 🎉");

      try {
        await updateScore(10);
      } catch (err) {
        console.error("Error updating score", err);
      }
    } else {
      setFeedback("Wrong ❌");
    }
    setUserInput("");
    fetchNewQuestion();
  };

  const handleNumberClick = (num) => {
    setUserInput(num);
  };

  return (
    <div className="Gbody">
      <div className="GameContainer">
        <div className="overlayG">
          {/* ✅ Main Menu Button (Preserved as Original) */}
          <button
            className="mainmenu-icon"
            style={{
              position: "absolute",
              top: "20px",
              right: "50px",
              cursor: "pointer",
              background: "orange",
              borderRadius: "50%",
              padding: "10px",
            }}
            onClick={() => navigate("/dashboard")}
          >
            <HomeIcon size={30} color="white" />
          </button>

          <div className="game-container">
            <div className="score-timer-container">
              <div className="score-block">Score: {score}</div>
              <div className="timer-block">Time Left: {timeLeft}s</div>
            </div>

            <div className="question-container">
              {question && (
                <img src={question} alt="Math Puzzle" className="question-image" />
              )}
            </div>

            {/* ✅ Number Pad (Same as Original) */}
            <div className="number-pad">
              {[1, 2, 3, 4, 5, 6, 7, 8, 9, 0].map((num) => (
                <button
                  key={num}
                  onClick={() => handleNumberClick(num)}
                  className={`number-button ${userInput === num ? "selected" : ""}`}
                >
                  {num}
                </button>
              ))}
            </div>

            <button onClick={handleSubmit} className="submit-button" disabled={userInput === ""}>
              Submit
            </button>

            <p className="feedback">{feedback}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Game;
